import React, { useEffect } from 'react';
import { useRouter } from 'next/router'; // Імпорт роутера з Next.js

const MiddlePage = () => {
    const router = useRouter(); // Ініціалізація роутера

    useEffect(() => {
        const timer = setTimeout(() => {
            router.push('https://www.zalando.pl/oysho-comfortlux-piping-short-kombinezon-black-oy141k017-q11.html');
        }, 10000);

        return () => clearTimeout(timer);
    }, [router]);

    return (
        <section className='middle-page'>
            <svg className='spinner' viewBox='0 0 50 50'>
                <circle className='path' cx='25' cy='25' r='20' fill='none' strokeWidth='5'></circle>
            </svg>
        </section>
    );
};

export default MiddlePage;
